selectBoxIt.setOptions=function(newOptions,callback){var self=this,firstOption=self.listItems.eq(0);$.Widget.prototype._setOptions.apply(self,arguments);if(self.options.showFirstOption){firstOption.show();}else{firstOption.hide();}if(self.options.defaultIcon){self.dropdownImage.attr("class",self.options.defaultIcon+" selectboxit-arrow");}if(self.options.downArrowIcon){self.downArrow.attr("class",self.options.downArrowIcon+" selectboxit-arrow");}if(self.options.defaultText){self._setText(self.dropdownText,self.options.defaultText);}self._callbackSupport(callback);return self;};